import { useState, useEffect } from 'react';
import { 
  Box, 
  TextField, 
  Button, 
  Typography, 
  Container, 
  Paper,
  MenuItem,
  Alert
} from '@mui/material';
import { useNavigate, useParams } from 'react-router-dom';
import { createCar, updateCar, getCars } from '../services/api';

const NIVELES_GASOLINA = [
  'VACIO',
  'CUARTO',
  'MEDIO',
  'TRES_CUARTOS',
  'LLENO'
];

function CarForm() {
  const { id } = useParams();
  const navigate = useNavigate();
  const [loading, setLoading] = useState(false);
  const [error, setError] = useState('');
  const [car, setCar] = useState({
    matricula: '',
    modelo: '',
    color: '#000000',
    nivelGasolina: 'VACIO'
  });

  useEffect(() => {
    if (id) {
      loadCar();
    }
  }, [id]);

  const loadCar = async () => {
    try {
      const cars = await getCars();
      const carToEdit = cars.find(c => c.id === parseInt(id));
      if (carToEdit) {
        setCar(carToEdit);
      } else {
        setError('Coche no encontrado');
      }
    } catch (error) {
      console.error('Error al cargar el coche:', error);
      setError('Error al cargar el coche');
    }
  };

  const handleChange = (e) => {
    setCar({
      ...car,
      [e.target.name]: e.target.value
    });
  };

  const handleSubmit = async (e) => {
    e.preventDefault();
    setLoading(true);
    setError('');

    try {
      if (id) {
        await updateCar(id, car);
      } else {
        await createCar(car);
      }
      navigate('/cars');
    } catch (error) {
      console.error('Error al guardar el coche:', error);
      setError('Error al guardar el coche. Por favor, intente de nuevo.');
    } finally {
      setLoading(false);
    }
  };

  return (
    <Container maxWidth="sm">
      <Box sx={{ mt: 4 }}>
        <Paper elevation={3} sx={{ p: 4 }}>
          <Typography variant="h5" component="h2" gutterBottom>
            {id ? 'Editar Coche' : 'Nuevo Coche'}
          </Typography>

          {error && (
            <Alert severity="error" sx={{ mb: 2 }}>
              {error}
            </Alert>
          )}

          <Box component="form" onSubmit={handleSubmit}>
            <TextField
              margin="normal"
              required
              fullWidth
              name="matricula"
              label="MatrÃ­cula"
              value={car.matricula}
              onChange={handleChange}
              disabled={loading}
            />

            <TextField
              margin="normal"
              required
              fullWidth
              name="modelo"
              label="Modelo"
              value={car.modelo}
              onChange={handleChange}
              disabled={loading}
            />

            <TextField
              margin="normal"
              required
              fullWidth
              name="color"
              label="Color"
              type="color"
              value={car.color}
              onChange={handleChange}
              disabled={loading}
              sx={{
                '& input': {
                  height: 50,
                  width: '100%',
                  padding: '0.5rem'
                }
              }}
            />

            <TextField
              margin="normal"
              required
              fullWidth
              select
              name="nivelGasolina"
              label="Nivel de Gasolina"
              value={car.nivelGasolina}
              onChange={handleChange}
              disabled={loading}
            >
              {NIVELES_GASOLINA.map((nivel) => (
                <MenuItem key={nivel} value={nivel}>
                  {nivel}
                </MenuItem>
              ))}
            </TextField>

            <Box sx={{ mt: 3, display: 'flex', gap: 2 }}>
              <Button
                type="submit"
                variant="contained"
                fullWidth
                disabled={loading}
              >
                {loading ? 'Guardando...' : 'Guardar'}
              </Button>
              <Button
                variant="outlined"
                fullWidth
                onClick={() => navigate('/cars')}
                disabled={loading}
              >
                Cancelar
              </Button>
            </Box>
          </Box>
        </Paper>
      </Box>
    </Container>
  );
}

export default CarForm;
